import Layout from '../components/PageLayout';

const Index = () => (
  <Layout>
    <div style={{paddingTop:60, paddingLeft:"5vw", paddingRight:"5vw"}}>
      <img src="/tarasmonitor.png" width="600"></img>
      <span >Modern Solutions</span>
    </div>

  </Layout>
);

export default Index;
